## FQualitativeProperty labels - French

## FQualitativeProperty
FQualitativeProperty = Variables qualitatives
FQualitativeProperty.description = Filtre de sélection pour des individus présentant des "variables qualitatives", c'est à dire prenant une valeur parmi n possibles.
FQualitativeProperty.emptyList = Aucun individu à filtrer
FQualitativeProperty.propertyHasUnknownType = La variable a un type inconnu
